css:
.git-blame {
  overflow: hidden;
  background-color: #292c2f;
  border-right: 1px solid rgba(0, 0, 0, 0.5);
  border-left: 1px solid rgba(0, 0, 0, 0.5);
}
.git-blame .blame-lines {
  padding-bottom: 30px;
}
.git-blame .blame-lines .blame-line {
  padding: 0 7px 0 4px;
}
.git-blame .blame-lines .blame-line.line-bg-lighter {
  background-color: #323639;
}
.git-blame .blame-lines .blame-line.line-bg-darker {
  background-color: #1f2224;
}
.git-blame .blame-lines .blame-line.no-commit {
  text-align: center;
}
.git-blame .blame-lines .blame-line .hash {
  padding-right: 10px;
}
.git-blame .blame-lines .blame-line .date {
  padding-right: 10px;
}
.git-blame .blame-lines .blame-line .committer {
  float: right;
}
